import './App.css';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <header>
        <ul>
          <Navbar>About me</Navbar>
          <Navbar>My projects</Navbar>
          <Navbar>Contact me</Navbar>
        </ul>
      </header>
    </div>
  );
}

export default App;
